import React from 'react';
import CenterDiv from './CenterDiv';
import CenterToggle from './CenterToggle';
import CenterVideo from './CenterVideo';
import NavBar from './NavBar';
import TopNav from './TopNav';
import Vodafone from './Vodafone';


const data = [
	{
		id: 1,
		title: 'Card 1',
		description: 'This is the description for card 1.',
		image: 'https://picsum.photos/id/1015/367/267',
	},
	{
		id: 2,
		title: 'Card 2',
		description: 'This is the description for card 2.',
		image: 'https://picsum.photos/id/1016/367/267',
	},
	{
		id: 3,
		title: 'Card 3',
		description: 'This is the description for card 3.',
		image: 'https://picsum.photos/id/1018/367/267',
	},
];


function App() {

	return (
		<div className='app'>
			<TopNav />
			<NavBar />
			<CenterDiv />
			<CenterVideo />
			<CenterToggle />
			<Vodafone />
		</div>
	);
}

export default App;
